What do you think is a perfect match!?

For some opposites attract for others you need similarities, for some you need to know spend enough time with the person for other they sway away in love at first sight..
What is perfect then? 
In my opinion, it’s you being able to be who you truly are,
Having all your vulnerabilities, fears,  expectations and baggages on the table and yet feel loved is what all of it. That’s what perfect is.

Have you found your perfect!?

